import axios from "axios";
import { apiClient } from "./BaseUrl";

export const retrieveAllToDos = (username) => apiClient.get(`/users/${username}/todos`)
export const retrieveTodoForId = (username, id) => apiClient.get(`/users/${username}/todos/${id}`)
